const fs = require('fs');

function replaceExpressionsInFile(filePath, replacements) {
  try {
    // Read the contents of the file synchronously
    let fileContent = fs.readFileSync(filePath, 'utf-8');

    // Replace all occurrences of each expression with its corresponding replacement
    for (const [expression, replacement] of Object.entries(replacements)) {
      const regex = new RegExp(`\\b${expression}\\b`, 'g');
      fileContent = fileContent.replace(regex, replacement);
    }

    // Write the updated contents back to the same file synchronously
    fs.writeFileSync(filePath, fileContent);

    console.log(`Replacements complete in file: ${filePath}`);
  } catch (error) {
    console.error(`Error while replacing expressions: ${error}`);
  }
}

